%script

BEGIN EXECUTE IMMEDIATE 'DROP TABLE nmf_ltv_settings';
EXCEPTION WHEN OTHERS THEN NULL; END;

%script

BEGIN
  insert into nmf_ltv_settings (SETTING_NAME, SETTING_VALUE) values
  (DBMS_DATA_MINING.PREP_AUTO,DBMS_DATA_MINING.PREP_AUTO_ON);
  insert into nmf_ltv_settings (SETTING_NAME, SETTING_VALUE) values
  (dbms_data_mining.feat_num_features, 5);

END;

%script

BEGIN DBMS_DATA_MINING.DROP_MODEL('NMF_LTV_MDL');
EXCEPTION WHEN OTHERS THEN NULL; END;
/

BEGIN
  DBMS_DATA_MINING.CREATE_MODEL(
    model_name          => 'NMF_LTV_MDL',
    mining_function     => dbms_data_mining.feature_extraction,
    DATA_TABLE_NAME     => 'CUST_V',
    CASE_ID_COLUMN_NAME => 'customer_id',
    settings_table_name => 'nmf_ltv_settings');
END;
